import React from "react";
class Cart extends React.Component {
  render() {
    return (
      <div>
        <div className="md:flex">
          <div className="flex">
            <span className="text-xl font-bold">My Cart</span>
          </div>
        </div>
      </div>
    );
  }
}

export default Cart;
